import React from 'react';
import { Text, View, StyleSheet, SafeAreaView,Alert,Button, Image,TouchableHighlight} from 'react-native';
const ListItems = ({el,deleteHandler}) => {
  return (
    <TouchableHighlight onPress = {(deleteHandler(el.key))}>
    <Text style = {styles.text}> {el.text} </Text>
    </TouchableHighlight>
   );
};
export default ListItems;
const styles = StyleSheet.create({
  text:
  {
    padding: 20,
    textAlign : 'center',
    borderRadius: 5,
    backgroundColor: '#fafafa',
    borderWidth: 1,
    marginTop: 20,
    width: '60%',
    marginLeft : '20%',
  }
  });
